import React, { Component } from "react";
import styled from "styled-components";
const Banner = styled.h1`
  padding: 1em;
  /* background: green; */
  color: navy;
`;
class LandingPage extends Component {
  state = {};
  render() {
    return (
      <div>
        <Banner>Demo ssr</Banner>
      </div>
    );
  }
}

export default LandingPage;
